const Img_API= "https://image.tmdb.org/t/p/w1280";

const Movie = ({title,poser_path,overview,vote_average}) => {
    return (
        <>
            <div className="movie">
                 <img src={Img_API+poser_path} alt={title} />
            </div>
        </>
    )
}

export default Movie;
